function editaCamposPrecioEspecial(opcion) {

    var idSeleccion = document.getElementById("cboTipoProducto").value;

    if (opcion == 1) {
        switch (idSeleccion) {
            case "1":
                document.getElementById("pe1").disabled = false; document.getElementById("pe2").disabled = false; document.getElementById("pe3").disabled = false; document.getElementById("pe4").disabled = false;
                document.getElementById("btnSolicitaAutorizar").disabled = false;
                document.getElementById("btnEdita").disabled = true;
                break;
            case "2":
                document.getElementById("pe5").disabled = false; document.getElementById("pe6").disabled = false; document.getElementById("pe7").disabled = false; document.getElementById("pe8").disabled = false;
                document.getElementById("btnSolicitaAutorizar").disabled = false;
                document.getElementById("btnEdita").disabled = true;
                break;
            case "3":
                document.getElementById("pe9").disabled = false; document.getElementById("pe10").disabled = false; document.getElementById("pe11").disabled = false; document.getElementById("pe12").disabled = false;
                document.getElementById("btnSolicitaAutorizar").disabled = false;
                document.getElementById("btnEdita").disabled = true;
                break;
        }
    }
    if (opcion == 2) {
        switch (idSeleccion) {
            case "1":
                document.getElementById("pe1").disabled = true; document.getElementById("pe2").disabled = true; document.getElementById("pe3").disabled = true; document.getElementById("pe4").disabled = true;
                document.getElementById("btnSolicitaAutorizar").disabled = true;
                document.getElementById("btnEdita").disabled = false;
                break;
            case "2":
                document.getElementById("pe5").disabled = true; document.getElementById("pe6").disabled = true; document.getElementById("pe7").disabled = true; document.getElementById("pe8").disabled = true;
                document.getElementById("btnSolicitaAutorizar").disabled = true;
                document.getElementById("btnEdita").disabled = false;
                break;
            case "3":
                document.getElementById("pe9").disabled = true; document.getElementById("pe10").disabled = true; document.getElementById("pe11").disabled = true; document.getElementById("pe12").disabled = true;
                document.getElementById("btnSolicitaAutorizar").disabled = true;
                document.getElementById("btnEdita").disabled = false;
                break;
        }
    }
}

